.buttons {
	.buttons_grid {
		display: grid;
		grid-template-columns: repeat(5, 1fr);
		grid-template-rows: repeat(5, minmax(150px, 1fr));
		justify-items: center;
		align-items: center;
	}
	.menu {
		position: relative;
		display: inline-block;
		width: 36px;
		height: 28px;
		span {
			position: absolute;
			left: 0;
			width: 100%;
			height: 4px;
			border-radius: 2px;
			background: #000;
			transition: 0.3s;
			&:nth-child(1) {
				top: 0;
			}
			&:nth-child(2) {
				top: 12px;
			}
			&:nth-child(3) {
				bottom: 0;
			}
		}
	}
}

// ham1
.ham1.active {
	span {
		&:nth-of-type(1) {
			transform: translateY(12px) rotate(-45deg);
		}
		&:nth-of-type(2) {
			opacity: 0;
		}
		&:nth-of-type(3) {
			transform: translateY(-12px) rotate(45deg);
		}
	}
}

// ham2
.ham2.active {
	span {
		&:nth-of-type(1) {
			transform: translateY(12px) rotate(-315deg);
		}
		&:nth-of-type(2) {
			opacity: 0;
		}
		&:nth-of-type(3) {
			transform: translateY(-12px) rotate(315deg);
		}
	}
}

// ham3 {
@keyframes ham3InFirst {
	0% {
		transform: translateY(0);
	}
	50% {
		transform: translateY(12px);
	}
	100% {
		transform: translateY(12px) rotate(45deg);
	}
}
@keyframes ham3OutFirst {
	0% {
		transform: translateY(12px) rotate(45deg);
	}
	50% {
		transform: translateY(12px) rotate(0);
	}
	100% {
		transform: rotate(0) translateY(0);
	}
}
@keyframes ham3InEnd {
	0% {
		transform: translateY(0);
	}
	50% {
		transform: translateY(-12px) rotate(0);
	}
	100% {
		transform: translateY(-12px) rotate(-45deg);
	}
}
@keyframes ham3OutEnd {
	0% {
		transform: translateY(-12px) rotate(-45deg);
	}
	50% {
		transform: rotate(0) translateY(-12px);
	}
	100% {
		transform: rotate(0) translateY(0);
	}
}
.ham3 {
	span {
		&:nth-of-type(1) {
			animation: ham3OutFirst 0.5s forwards;
		}
		&:nth-of-type(2) {
			opacity: 1;
			transition: 0.5s;
		}
		&:nth-of-type(3) {
			animation: ham3OutEnd 0.5s forwards;
		}
	}
}
.ham3.active {
	span {
		&:nth-of-type(1) {
			animation: ham3InFirst 0.5s forwards;
		}
		&:nth-of-type(2) {
			opacity: 0;
		}
		&:nth-of-type(3) {
			animation: ham3InEnd 0.5s forwards;
		}
	}
}

// ham4
.ham4.active {
	span {
		&:nth-of-type(1) {
			transform: rotate(-50deg) translateX(-7px);
			width: 20px;
		}
		&:nth-of-type(2) {
		}
		&:nth-of-type(3) {
			transform: rotate(50deg) translateX(-7px);
			width: 20px;
		}
	}
}
// ham5
@keyframes move1FadeIn {
	100% {
		transform: translateY(12px) rotate(45deg);
	}
}
@keyframes move2FadeIn {
	100% {
		opacity: 0;
	}
}
@keyframes move3FadeIn {
	100% {
		transform: translateY(-12px) rotate(-45deg);
	}
}

@keyframes move1FadeOut {
	0% {
		transform: translateY(12px) rotate(45deg);
	}
	100% {
		transform: translateY(0) rotate(0);
	}
}
@keyframes move2FadeOut {
	100% {
		opacity: 1;
	}
}
@keyframes move3FadeOut {
	0% {
		transform: translateY(-12px) rotate(-45deg);
	}
	100% {
		transform: translateY(0) rotate(0);
	}
}
.ham5 {
	transition: 0.5s;
	transform: rotate(0);
	transition-delay: 0.8s;
	span {
		&:nth-of-type(1) {
			animation: move1FadeOut 0.5s forwards;
		}
		&:nth-of-type(2) {
			animation: move2FadeOut 0.5s forwards;
		}
		&:nth-of-type(3) {
			animation: move3FadeOut 0.5s forwards;
		}
	}
}
.ham5.active {
	transition: 0.5s;
	transform: rotate(-90deg);
	transition-delay: 0s;
	span {
		&:nth-of-type(1) {
			animation: move1FadeIn 0.5s 0.8s forwards;
		}
		&:nth-of-type(2) {
			animation: move2FadeIn 0.5s 0.8s forwards;
		}
		&:nth-of-type(3) {
			animation: move3FadeIn 0.5s 0.8s forwards;
		}
	}
}

// buttons ring
.buttons_ring {
	position: relative;
	left: 50%;
	margin-left: -34px;
	width: 68px;
	height: 68px;
	.burger_line {
		position: absolute;
		left: 50%;
		top: 50%;
		transform: translate(-50%, -50%);
		width: 36px;
		height: 28px;
		z-index: 1;
	}
	.burger_ring {
		position: absolute;
		left: 50%;
		top: 50%;
		width: 68px;
		height: 68px;
		margin: -34px 0 0 -34px;
		z-index: 0;
	}
	.burger_ring .svg_ring {
		width: 68px;
		height: 68px;
	}
	.burger_ring .path {
		stroke: red;
		stroke-dasharray: 240;
		stroke-dashoffset: 240;
		stroke-linejoin: round;
	}
	.path_burger {
		position: absolute;
		top: 0;
		left: 0;
		height: 68px;
		width: 68px;
		-webkit-mask: url(#mask);
		mask: url(#mask);
		-webkit-mask-box-image: url(https://raygun.io/upload/mask.svg);
	}
	.animate_path {
		position: absolute;
		top: 0;
		left: 0;
		width: 68px;
		height: 68px;
	}
	.path_rotation {
		height: 34px;
		width: 34px;
		margin: 34px 34px 0 0;
		transform: rotate(0deg);
		transform-origin: 100% 0;
	}
	.path_rotation:before {
		content: "";
		display: block;
		width: 30px;
		height: 34px;
		margin: 0 4px 0 0;
		background: red;
	}
	span[class^="ham"] {
		display: block;
		width: 100%;
		height: 4px;
		background: red;
		border-radius: 2px;
		transition: 0.5s;
		position: absolute;
		left: 0;
	}
	.ham1 {
		top: 0;
		transform-origin: 34px 2px;
	}
	.ham2 {
		top: 12px;
	}
	.ham3 {
		bottom: 0;
		transform-origin: 34px 2px;
	}
}
.buttons_ring.opened .ham1 {
	animation: ham1Rotate 0.65s;
	animation-fill-mode: forwards;
}
.buttons_ring.opened .ham2 {
	animation: hamRound-in 0.65s;
	animation-fill-mode: forwards;
}
.buttons_ring.opened .ham3 {
	animation: ham2Rotate 0.65s;
	animation-fill-mode: forwards;
}

.buttons_ring.opened .path {
	animation: dash_in 0.65s;
	animation-fill-mode: forwards;
}
.buttons_ring.opened .animate_path {
	animation: rotate-in 0.6s linear normal;
	animation-fill-mode: forwards;
}

.buttons_ring.closed .ham2 {
	animation: hamRound-out 0.95s linear normal;
}
.buttons_ring.closed .path {
	animation: dash_out 0.65s;
	animation-fill-mode: forwards;
}
.buttons_ring.closed .animate_path {
	animation: rotate-out 0.6s linear normal;
	animation-fill-mode: forwards;
}

@keyframes rotate-out {
	0% {
		transform: rotate(0deg);
	}
	40% {
		transform: rotate(180deg);
	}
	100% {
		transform: rotate(360deg);
	}
}

@keyframes rotate-in {
	0% {
		transform: rotate(360deg);
	}
	40% {
		transform: rotate(180deg);
	}
	100% {
		transform: rotate(0deg);
	}
